import React from 'react';
import {

    Row, Col,
} from 'reactstrap';

import {
    Professorslist
} from 'components';


import axios from 'axios'; //để get API 

// import { professors } from 'variables/university/professors.jsx';

class Professor extends React.Component{
   
    constructor(props){
        super(props);
        this.state = {
            admins: [],
            name: [],
            position: [],
            msg: [],
        }
    }

    componentDidMount() {
        axios.get(`http://localhost:3000/admin/show`)
        .then(res => {
            const admins = res.data;

            this.setState({ admins: admins });

            console.log(this.state.admins[0].name);
            // var data = [];
            // var time = [];
            // for (let i = 0; i < ultrasonics.length; i++) {
            // data[ultrasonics.length-1 - i] = ultrasonics[i]["value"];
            // time[ultrasonics.length-1 - i] = ultrasonics[i]["createdAt"]
            // }
            // console.log(data);

            // console.log(time);
            // this.setState({time: time})
            // this.setState({data: data})

        })
    }
    

    render(){
        
        return (
            <div>
                <div className="content">
                    <Row>
                        <Col xs={12} md={12}>

                    <div className="page-title">
                        <div className="float-left">
                            <h1 className="title">Admins</h1>
                        </div>
                    </div>


                            
           

                    <div className="col-xl-12">
                        <section className="box ">
                            <header className="panel_header">
                                <h2 className="title float-left">All Admins</h2>
                            </header>
                            <div className="content-body">    


                            <div className="row">
                                    <div className="col-12">


                                <Professorslist professors={professors} />

                                    </div>
                                </div>
                            </div>
                        </section></div>



           
                                
                        </Col>

                    </Row>
                </div>
            </div>
        );
    }
}

export default Professor;
